import './App.css';
import React, { Component } from 'react';

class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      nome: 'Ricardo',
      contador: 0,
    };
  }
  render() {
    return (
      <div className="App">
        <header className="App-header">
          <div>{this.state.nome}</div>
          <div>
            <h1>Contador</h1>
          </div>
        </header>
      </div>
    );
  }
}

export default App;
